import React from 'react';
import './DataAnaPage.css';

const DataAnaPage = () => {

    return (
        <div className='parent'>
            <div className='pnl_NavBar'></div>
            <div className='pnl_MemberBar'>
                <button className='btn_Chat'>TM</button>
                <h1 className='txt_MemberName'>NW</h1>
            </div>
            <div className='pnl_Title'>
                <h1 className='txt_DataAnalytics'>Data Analytics</h1>
            </div>
            <div className='pnl_CompletedTasks'></div>
            <div className='pnl_FilterData'></div>
            <div className='pnl_AOI'></div>
            <div className='pnl_Requirements'></div>
        </div>
    );
}

export default DataAnaPage;
